import Link from "next/link";
import fetch from "isomorphic-unfetch";

const Robots = () => {
    return (
        <div>
            <h1>Robots</h1>
            <Link href="/">Home</Link>
            <div>Robots data</div>
        </div>
    );
};

Robots.getInitialProps = async function () {
    const res = await fetch("");
};

export default Robots;
